import * as React from 'react';
import './banner.css';
import HomeBanner from '../img/home_banner.png';

export class Banner extends React.Component{
    render() {
        return (
            <div className="home-banner align-left">
                <div style={{flex: 4}}>
                </div>
                <div style={{flex: 6}}>
                    <h1 className="title">Núcleo de Empreendedorismo da USP</h1>
                </div>
                <div style={{flex: 10}}>
                </div>
            </div>
        )
    }
}
